import { useEffect } from "react";

const Input = (props) => {
  return (
    <div>
      <h1>{props.type}</h1>
      <h2>{props.id}</h2>
      <h3>{props.value}</h3>
      <h4>{props.onChange}</h4>
      <h5>{props.onBlur}</h5>
    </div>
  );
};

export default Input;
